function Stock(props){
    const stock=props.stock
    const price='$ '+stock.current_price.toLocaleString('en-US')
    const mk="$ "+stock.market_cap.toLocaleString('en-US')
    return(
        <tr>
            <td>{stock.name}</td>
            <td>{stock.symbol}</td>
            <td>{price}</td>
            <td>{mk}</td>
        </tr>
    )
}
export default Stock
